import React from 'react'

const Friends  = () =>
{
    return(
        <div>
            Friends Page!
            Friends List
            <FriendsList friends={['Shayan', 'Rahul', 'Akash', 'Kareena', 'Zoya']}/>
        </div>
    )
}


const FriendsList = (props) => {
    return (
        <ul>
            {props.friends.map(friend => <Friends friend= {friend} key={friend} />)}
        </ul>
    )
}
ReactDOM.render(<Friends />, document.getElementbyId('friends'));
export default Friends;
